(25, 'การแก้แค้นของผู้กลืนวิญญาณ ~เด็กหนุ่มอ่อนแอที่ถูกนักบุญดาบ (พ่อ) เนรเทศเพราะหาว่าไร้ค่า~', 16, '', '<p>ตอน ที่ 1 วัน แห่ง การ ตัดสิน</p><p>แคร็ก ! แคร็ก ! เสียง ของ ดาบ ไม้ ที่ กระเด็น ร่วง ลง สู่ พื้น ได้ ดัง ก้อง กังวาน ขึ้น</p><p>ผม จ้อง มอง ไป ยัง ความ ว่าง เปล่า ที่ อยู่ ใน มือ ของ ตัว เอง</p><p>“ พอ แค่ นี้ ! ” เสียง ผู้ ตัดสิน ดัง ออก มา อยู่ ไม่ ไกล</p><p>การ ต่อสู้ ครั้ง นี้ ผม จำเป็น ต้อง เอาชนะ ให้ ได้</p><p>แต่ สุดท้าย ผม กลับ พ่าย แพ้ อย่าง หมด รูป ดาบ ไม่ ได้ กระเด็น ไป จาก มือ ของ ผม</p><p>ผู้ ที่ อายุ ครบ 13 ปี จำเป็น ต้อง เข้า รับ พิธี ทดสอบ การ บรรลุนิติภาวะ ของ ศิษย์ สำนัก มา ยา ดาบ เดียว</p><p>คู่ ต่อสู้ ของ ใน ครั้ง นี้ คือ นักรบ เขี้ยว มังกร มัน เป็น นักรบ โครง กระดูก ที่ สร้าง ขึ้น มา จาก เวทมนตร์</p><p>แน่นอน ว่า มัน ไม่ใช่ คู่ ต่อสู้ ที่ อ่อนแอ ใน ความ เป็น จริง แล้ว การ จะ ต่อสู้ กับ มัน ด้วย ทหาร ธรรมดา ของ</p><p>จักรวรรดิ หรือ นัก ผจญ ภัย เพียง คน เดียว นั้น เป็น ไป ได้ ยาก มาก อาจ จะ กล่าว ได้ ว่า มัน ไม่ใช่ คู่ ต่อสู้ ที่ มี ไว้</p><p>เพื่อ ทดสอบ คน หนุ่ม สาว วัย นี้ เลย</p><p>แต่ ใน ที่ นี้ กลับ ไม่มี ใคร สงสัย ใน เรื่อง ที่ ตน จะ ต้อง มา เผชิญหน้า กับ คู่ ต่อสู้ เช่น นี้ เลย</p>', '2023-02-13 11:23:44', '2023-02-13 17:18:08', 1, 'การแก้แค้นของผู้กลืนวิญญาณ-~เด็กหนุ่มอ่อนแอที่ถูกนักบุญดาบ-(พ่อ)-เนรเทศเพราะหาว่าไร้ค่า~', 'c5853042639b9413d53df3e7e62f0614.jpg', 0, 0);
