(28, 'วันๆของพวกเธอ ก็งี้แหละ //Asobi Asobase', 16, 'เรื่องราวของชายวัยกลางคนทำทุกอย่างที่ต้องการด้วยพลังของการช็อปปิ้งออนไลน์ เพียง 1 คลิก! ที่ต่างโลก', '<p>“ จาก ที่ สังเกต มา พัก ใหญ่ ... ไอ้ เจ้า นี้ ดู ท่า จะ ไล่ ล่า เรา อย่าง เดียว เลย ไม่ ... จะ พูด ให้ ถูก คือ ... มัน น่า จะ</p><p>ไล่ เธอ นะ ลู ซิ เรี ย ”</p><p>ฉัน อธิบาย แบบ นั้น ลู ซิ เรี ย ก็ พยัก หน้า เข้าใจ นับ ตั้งแต่ มัน โผล่ มา นี่ ก็ ผ่าน ไป พอ สมควร แล้ว หอก ที่ มัน</p><p>ปา มา นับ สิบ เล่ม แล้ว</p><p>พอ ปา มา มัน ก็ เสก ใหม่ ขึ้น มา เรื่อย ๆ ซะ อย่าง นั้น ไม่ ว่า พวก เรา จะ วิ่ง ไป ทาง ไหน มัน ก็ จะ เคลื่อนที่ ตาม</p><p>ด้วย ความเร็ว มากกว่า</p><p>น่า แปลก ที่ เจ้า นี่ เป็น คน ที่ ต้อง ปกป้อง ต้นไม้ อะไร สัก อย่าง แท้ๆ กลับ เลือก จะ มา โจมตี พวก เรา ต่อ ให้</p><p>ออก ห่าง ต้นไม้ มา เนีย</p><p>ไม่ สิ ตาม คำ ที่ เขียน ไว้ ใน ศิลา เจ้า หมอ นี่ คือ นักรบ ไม่ใช่ อัศวิน ... เดิมที คำ ว่า นักรบ กับ อัศวิน ก็ แตก ต่าง</p><p>กัน พอ สมควร อยู่ แล้ว</p><p>กล่าว คือ หน้าที่ ของ นักรบ ก็ ตรง ตัว ... เป็น บุคคล ที่ มี เป้าหมาย ใน การ รบ ถึง แม้ เขา จะ มี หน้าที่ ปกป้อง</p><p>ต้นไม้ แต่ เขา ก็ ยัง เป็น นักรบ นั่นแหละ</p><p>ใน วินาที ต่อ มา นั้น เอง ดวงตา ที่ หน้าอก ของ มัน เรือน แสง ขึ้น อีก ครั้ง หอก ปรากฏ ใน มือ ... ท ว่า คราว นี้</p><p>กลับ ไม่ใช่ หอก หิน</p><p>แต่ เป็น หอก เหล็กกล้า วินาที ที่ มัน กำ และ ปา มา นั้น มัน พุ่ง จน ทะลุ อากาศ แหวก พื้นที่ ออก จาก กัน กลาย</p><p>เป็น เหมือนกับ ลูก ศร แห่ง การ ทำลาย ล้าง</p><p>กวาด ทำลาย ต้นไม้ ทุก อย่าง ใน ระยะ ฉัน กัด ริมฝีปาก ... ที่ ฉัน ใส่ อยู่ ที่ เรือน แสง สีน้ำเงิน ขึ้น ... ถ้า จะ พูด</p><p>ให้ ถูก คือ สี นิล กาฬ</p><p>“ นี่ มัน ใช่ อัญมณี ไพลิน จริงๆ ใช่ ไหม ? ”</p><p>“ อื ม .. ข้า มั่นใจ ”</p><p>ใน ห้อง พัก ฉัน คุย กับ สกา เล็ ต มอง ไป ที่ ซึ่ง ตอน นี้ มี สาม สี ตัด สลับ กัน อย่าง พิศวง ... สกา เล็ ต ครุ่นคิด อยู่</p><p>พัก หนึ่ง</p>', '2023-02-13 14:58:23', '2023-02-13 16:21:33', 1, 'วันๆของพวกเธอ-ก็งี้แหละ-//Asobi-Asobase', 'c49adc558ab51dfb200262dcd8f2c044.jpg', 0, 0),
(29, 'จะเกิดอะไรขึ้นเมื่อผมช่วยสองพี่น้องสาวสวยที่เกลียดผู้ชายโดยไม่บอกแม้แต่ชื่อ!?', 23, '', '<p>\" สิ่ง ที่พึ่ง ได้ คือ หมวก ฟักทอง \"</p><p>ช่วง ปลาย เดือน ตุลาคม ผม ออก ไป ซื้อ ของ ต่างๆ เพื่อ เตรียมพร้อม สำหรับ วัน ฮาโลวีน คุณ อาจ จะ สงสัย</p><p>ว่า ผม จะ ทำ อะไร ทั้งๆ ที่ อยู่ ม . ปลาย ปี 2 แล้ว แน่นอน ว่า ผม ไม่ ได้ ตั้งใจ จะ เอา ไป สร้าง ปัญหา อย่าง ที่ พบ</p><p>เจอ อยู่ ตาม ข่าว ก็ แค่ กะ จะ แต่ง คอส เพล ย์ และ ไป กิน ข้าว กับ เพื่อน ๆ เฉยๆ</p><p>[ ไล ท์ เซ เบอร์ หมวก ฟักทอง ... เยี่ยม สมบูรณ์ แบบ ไป เลย</p><p>ผม มี เพื่อน ที่ ชอบ แต่ง คอส เพล ย์ ถึง เขา จะ บอก ว่า กำลัง เตรียม ชุด แบบ จริงจัง อยู่ ก็ เถอะ แต่ สำหรับ ผม</p><p>แค่ นี้ ก็ ถือว่า โอ เค แล้ว</p><p>[ ... อื้ ม ม ม ? ]</p><p>ผม ค่อนข้าง พอใจ กับ สิ่ง ที่ ตัว เอง พึ่ง จะ ซื้อ มา และ ระหว่าง ทาง กลับ บ้าน ผม ก็ เหลือบ ไป เห็น บ้าน หลัง นึง</p><p>( บ้าน ของ ชิน โจ ซัง ... งั้น หรอ ?</p><p>ซิ น โจ ซัง พี่น้อง สาว สวย ที่ อยู่ ชั้น เรียน เดียว กับ ผม พวก เธอ ทั้ง งดงาม และ มี สไตล์ โดด เด่น ถึงขนาด ที่ ไอ</p><p>ด อ ล สมัย นี้ ยัง เทียบ ไม่ ติด นับ ครั้ง ไม่ ถ้วน ที่ มี คน ไป สารภาพ รัก กับ พวก เธอ ถึง อย่าง นั้น มัน กลับ เป็น</p><p>กำแพง เหล็ก ที่ สูง ชัน เพราะ พวก เธอ ปฏิเสธ พวก เขา ทั้งหมด</p><p>บ้าน ของ ผม เอง ก็ อยู่ ไม่ ไกล จาก ที่ นี่ มี หลาย ครั้ง ที่ พวก เรา เจอ และ ทักทาย กัน ระหว่าง ทาง ไป โรงเรียน</p><p>เข้า</p><p>[ อรุณ สวัสดิ์ ]</p><p>[ อรุณ สวัสดิ์ ]</p><p>มัน เป็น ความ สัมพันธ์ แบบ หนึ่ง เพราะ เรา อาศัย อยู่ ใกล้ กัน แต่ มัน ก็ ไม่ ได้ แย่ ที่ ได้ รับ การ ปฏิบัติ แบบ นี้</p><p>แน่นอน ว่า พวก เรา ไม่ เคย ไป โรงเรียน ด้วย กัน และ แม้ จะ ไม่ ได้ คุย กัน เลย ที่ โรงเรียน แต่ พวก เรา ก็ รู้จัก กัน</p>', '2023-02-13 17:23:18', NULL, 1, 'จะเกิดอะไรขึ้นเมื่อผมช่วยสองพี่น้องสาวสวยที่เกลียดผู้ชายโดยไม่บอกแม้แต่ชื่อ!?', '2318f540eac8f26a4254d8222e362870.jpg', 0, 0),
(30, 'เกมยิงเปลื้องผ้าคุณภรรยาปีศาจ ลด 40%', 16, '', '<p>Shoot Shoot My Waifu เกมยิงเปลื้องผ้าคุณภรรยาปีศาจ ลด 40% บน Steam ตอนนี้!</p><p>.</p><p>ในตอนนี้ Shoot Shoot My Waifu เกมยิงเปลื้องผ้าสาวๆ ปีศาจภาคต่อของ 7 Sexy Sins กำลังลดราคา 40% ในเว็บ Steam เหลือราคา 51 บาท&nbsp;</p><p>.</p><p>รายละเอียดเพิ่มเติมดูที่หน้าร้านค้า</p><p>https://store.steampowered.com/.../Shoot_Shoot_My_Waifu/</p><p>.</p><p>ดีลนี้หมดเวลาในวันที่ 7 ก.ค.</p><p>.</p><p>ส่วน 7 Sexy Sins ลด 50% เหลือ 22.50 บาท</p><p>https://store.steampowered.com/app/1023740/7_Sexy_Sins/</p><p>.</p><p>Shoot Shoot My Waifu คือเกมแนวชู้ตติ้งที่เล่าเรื่องราวของราฟาเอล หลังจากปราบปีศาจสาวทั้ง 7 ใน 7 Sexy Sins ภาคแรก ทำให้พวกเธออับอายและหลบหนีมาซ่อนตัวยังโลกมนุษย์ ทำให้ราฟาเอลอดรนทนไม่ไหว ต้องปลอมตัวไปชำระล้างบาปกับพวกนางต่อ</p><p>.</p><p>โดยคุณจะได้รับบทเป็นราฟาเอล เทวดาผู้ครอบครองอัลบั้มสาวๆ ทั้ง 3 ภพ ในภารกิจค้นหาปีศาจแห่งบาปทั้ง 7 ในร่างมนุษย์เมีย ต่อสู้ด้วยอาวุธใหม่ที่ทรงพลังขึ้น ฝ่าฟันผ่านเหล่าลูกกระจ๊อก หลบกระสุนเพื่อไปเผชิญหน้ากับบอสปีศาจสาวสวย ลงโทษด้วยน้ำศักดิ์สิทธ์ และใช้อุปกรณ์ชำระล้างในฉากหรรษาให้พวกเธอคืนร่างเดิมและสะสมภาพความพ่ายแพ้ที่น่าอับอายในอัลบั้มภาพของคุณ</p><p>.</p><p>ซึ่งใน Shoot Shoot My Waifu จะมีปีศาจยักษ์สุดเซ็กซี่ทั้งหมด 7 ตน และปีศาจลับที่คุณจะต้องค้นหาอีก 1 ตน ซึ่งจะมีการต่อสู้แตกต่างกันไป พร้อมด้วยมอนสเตอร์รายทางอีก 14 แบบ ชุดเกราะนับร้อยให้คุณปลดจากร่างกายของเหล่าสาวๆ พร้อมของเล่นสุดหรรษาอีก 24 ชิ้น ให้คุณได้สนุกไปกับฉากรักของพวกนางอีก 8 แบบ</p><p>.</p><p>เกมมี Patch 18+ ด้วย สามารถไปดูวิธีแก้ Patch ได้ที่นี่</p><p>https://steamcommunity.com/sharedfiles/filedetails/...</p>', '2023-02-13 17:28:32', '2023-02-22 18:10:14', 1, 'เกมยิงเปลื้องผ้าคุณภรรยาปีศาจ-ลด-40%', '95a63c4147ef12dcd33c20fe9aaa1a33.jpg', 0, 1),
